describe("getContainerData (method)",()=>{it("should get an empty object when it is not ready",()=>{const e=window.createImage(),t=new Cropper(e).getContainerData();expect(t).to.be.an("object").that.is.empty}),it("should get expect container data when ready",e=>{const t=window.createImage(),a=new Cropper(t,{ready(){const t=a.getContainerData();expect(t).to.be.an("object").that.has.all.keys(["width","height"]),expect(t.width).to.be.a("number"),expect(t.height).to.be.a("number"),e()}})})});